// src/data/studentData.js
const studentData = [
  {
    id: 'S1001',
    name: 'John Doe',
    email: 'john@example.com',
    phoneNumber: '123-456-7890',
    registrationDate: '2023-01-10',
    password: 'iam123', // Added password for login verification
  },
  {
    id: 'S1002',
    name: 'Jane Smith',
    email: 'jane@example.com',
    phoneNumber: '987-654-3210',
    registrationDate: '2023-02-05',
    password: 'iam456', // Added password for login verification
  },
];

export default studentData;
